import React, { Component } from 'react';

class Lol extends Component {
    state = {
        nombre: 350
    }
    render () {
        let {mot} = this.props;
        return (
        <div>
            <h1>CA FAIT {this.state.nombre}</h1>
            <h2>Ceci est un {mot}</h2>
        </div>)
    }
}

Lol.defaultProps = {
    mot: "coucou"
  };

export default Lol
